import React from "react";
import {
  CardContainer,
  CardTop,
  CardDot,
  CardBar,
  CardBg,
  CardBtn,
} from "./CardElms";

const Cards = () => {
  return (
    <CardContainer>
      <CardTop>
        <CardDot />
        <CardDot />
        <CardDot />
        <CardBar />
      </CardTop>
    </CardContainer>
  );
};

export default Cards;
